=head1 DESCRIPTION

Specifies managed data identifiers to exclude (not use) when performing
automated sensitive data discovery. For information about the managed
data identifiers that Amazon Macie currently provides, see Using
managed data identifiers
(https://docs.aws.amazon.com/macie/latest/user/managed-data-identifiers.html)
in the I<Amazon Macie User Guide>.

=head1 ATTRIBUTES


=head2 ManagedDataIdentifierIds => ArrayRef[Str|Undef]

An array of unique identifiers, one for each managed data identifier to
exclude. To retrieve a list of valid values, use the
ListManagedDataIdentifiers operation.



